import React from 'react';
import './DoubleArray.module.css'

const DoubleArray = (props) => {
    const numbers = [1, 2, 3, 4, 5];
    const doubleNums = numbers.map((number) => number * 2);

    // return
    return (
        <div className="container">
            <h2 className="title1">Double Array Numbers</h2>
            <p className="double-list">{props.map((num, index) => (
                    <p key={index} className="double-item">{num}</p>
                ))}
            </p>
        </div>
    );
};

export default DoubleArray;
